import { useSelector } from "react-redux"
import { useState } from "react";

import { selectCurrentLocation } from "../../Features/locations/locationsSlice"
import { useGetCityWeatherDataQuery } from "../../Features/locations/airVisualApiSlice";
import { useGetLocationKeyQuery } from "../../Features/locations/accuWeatherApiSlice";

import '../../Styles/location.css';
import '../../Styles/app.css';

import { StarBorder, StarFilled } from "../../Icons/svgImages/index.js";
import { selectCurrentUser } from "../../Features/auth/authSlice";

const LocationData = () => {
    const [isFavorited, setIsFavorited] = useState(false);

    const user = useSelector(selectCurrentUser);

    const locationBeingDisplayed = useSelector(selectCurrentLocation);
    console.log(locationBeingDisplayed);
    const skip = locationBeingDisplayed.city === null ? true : false;

    const { currentData: airVisualCurrentData, isLoading, isSuccess, error, isError, isFetching } = useGetCityWeatherDataQuery(locationBeingDisplayed, { skip })

    const locationName = locationBeingDisplayed.city === null ? <></> : <div id='location-name'>

        {locationBeingDisplayed.city.name}, {locationBeingDisplayed.province.name}, {locationBeingDisplayed.country.name}
    </div>

    const dateFormatted = isSuccess ? airVisualCurrentData?.data?.current?.weather?.ts.slice(5, 10) : <></>
    const timeFormatted = isSuccess ? airVisualCurrentData?.data?.current?.weather?.ts.slice(11, 16) : <></>

    const toggleFavorite = () => {
        if (isFavorited) setIsFavorited(false);
        else setIsFavorited(true);
    }

    const locationData = <article id="location-data-display" className="border" >
        <div id={user? 'favorites-button' : 'favorites-button-disabled'} className='optionsButtons'  onClick={ user ? () => toggleFavorite() : null}>
            {isFavorited? <StarFilled/> : <StarBorder/>}
        </div>
        {locationName}
        <div id="location-data" >
            <div id='weather' className="border">
                <div id='temperature'>{airVisualCurrentData?.data?.current?.weather?.tp}°C</div>
                <div id='other-weather-data'>
                    <span className="other-weather-data-entry" id="humidity">{airVisualCurrentData?.data?.current?.weather?.hu}%</span>
                    <span className="other-weather-data-entry" id="wind-speed">{airVisualCurrentData?.data?.current?.weather?.ws} m/s</span>
                    <span className="other-weather-data-entry" id='wind-direction'>{airVisualCurrentData?.data?.current?.weather?.wd}°</span>
                    <span className="other-weather-data-entry" id='atmospheric-pressure'>{airVisualCurrentData?.data?.current?.weather?.pr} hPa</span>
                </div>
            </div>
            <div id='pollution' className="border">
                <div id='AQI'>{airVisualCurrentData?.data?.current?.pollution?.aqius}</div>
                <span id='AQI-label'>Air Quality</span>
            </div>

        </div>
        <div>
            <span>Last updated </span>
            {dateFormatted}, {timeFormatted}
        </div>
    </article>

    const err = isError ? <span>{error?.data?.message}</span> : <></>
    const location = isSuccess ? locationData : <></>;


    return (
        <div className="location-data-container">
            {isError ? err : isLoading || isFetching ? <span>Loading...</span> : location}
        </div>
    )
}

export default LocationData
